css:
.nuclide-node-playground {
  display: flex;
  flex-direction: column;
  font-size: 1.25em;
  line-height: 1.4;
  color: #747369;
  background-color: #262626;
  overflow-x: auto;
  width: 100%;
}
.nuclide-node-playground-literal-text {
  white-space: pre;
}
.nuclide-node-playground-input {
  height: 200px;
}
.nuclide-node-playground-exception {
  color: #f2777a;
}
.nuclide-node-playground-editor {
  border: 1px solid rgba(0, 0, 0, 0.5);
  padding: 10px;
}
.nuclide-node-playground-results table {
  width: 100%;
}
.nuclide-node-playground-results-code {
  width: 50%;
}
.nuclide-node-playground-results-result {
  width: 50%;
}
.nuclide-node-playground-results-code-cell {
  font-size: 11px;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  border: 1px solid rgba(0, 0, 0, 0.5);
  padding: 10px;
  white-space: pre;
}
.nuclide-node-playground-results-result-cell {
  font-size: 11px;
  border: 1px solid rgba(0, 0, 0, 0.5);
  padding: 10px;
}
.nuclide-node-playground-results-input-cell {
  border: 1px solid rgba(0, 0, 0, 0.5);
  padding: 10px;
}
.nuclide-node-playground-results-div {
  position: relative;
}
.nuclide-node-playground-results-copy-button {
  position: absolute;
  bottom: 0;
  right: 0;
}
